import csvimport matplotlib.pyplot as pltimport numpywith open('tr.csv') as csv_file:    csv_reader = csv.reader(csv_file, delimiter=',')    line_count = 0    total = 0    Average =0    for row in csv_reader:        if line_count == 0:            print(f'Column names are {", ".join(row)}')            line_count += 1        else:            print(f'Z height is \t{row[2]}')            total += float(row[2])            line_count += 1    print(f"Processed {line_count} lines.")    format(total, '.2f')    print(f"Total is {total}.")    Average = total / line_count    round(Average, 2)    print(f"The Average is  {Average}.")    plt.figure(1)    plt.plot(row[2])    plt.xlabel('Asic position')    plt.ylabel('Height in mm')    plt.title('Asic pad height')